import React from "react";
import CardItem from "./CardItem";

function Cards() {
  return (
    <div className=" cards">
      <h1>Check out some of my projects</h1>
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items"></ul>
          <CardItem />
        </div>
      </div>
    </div>
  );
}

export default Cards;
